

def newState(state,n):
    new = ''
    for i in range(n):
        before = state[i-1]
        if i == len(state) - 1:
            after = state[0]
        else:
            after = state[i+1]
        newBit = '1' if int(before) + int(after) == 1 else '0'

        new = new + newBit

    return new


def newStateBin(s,n):
        
    left = s[1:] + s[0]
    right = s[-1] + s[:-1]
    # print(left,right)
    res = (int(left,2) ^ int(right,2))
    # res = (bin(left) ^ bin(right))
    # print("{0:015b}".format(res))
    return "{0:0{n}b}".format(res,n=n)
    # print(len(res))
